import React, { useState, useEffect } from "react";
import { FiMenu, FiX } from "react-icons/fi";
import { FaBuilding, FaCode, FaUser, FaBoxOpen, FaCog, FaSignOutAlt, FaChartBar, FaUsers, FaClipboard, FaWrench } from "react-icons/fa";

const Sidebar = () => {
  const [isOpen, setIsOpen] = useState(true);
  const [isMobile, setIsMobile] = useState(false);

  useEffect(() => {
    const handleResize = () => {
      setIsMobile(window.innerWidth <= 768);
      if (window.innerWidth <= 768) {
        setIsOpen(false);
      } else {
        setIsOpen(true);
      }
    };

    window.addEventListener("resize", handleResize);
    handleResize();

    return () => window.removeEventListener("resize", handleResize);
  }, []);

  const navigationItems = [
    {
      category: "Administrative",
      items: [
        { name: "Dashboard", icon: <FaChartBar />, current: true },
        { name: "User Management", icon: <FaUsers /> },
        { name: "Reports", icon: <FaClipboard /> },
        { name: "Settings", icon: <FaWrench /> }
      ]
    },
    {
      category: "Company",
      items: [
        { name: "Overview", icon: <FaBuilding /> },
        { name: "Departments", icon: <FaUsers /> }
      ]
    },
    {
      category: "Developers",
      items: [
        { name: "Code Repository", icon: <FaCode /> },
        { name: "Sandbox", icon: <FaBoxOpen /> }
      ]
    },
    {
      category: "Profile",
      items: [
        { name: "Settings", icon: <FaCog /> },
        { name: "Logout", icon: <FaSignOutAlt /> }
      ]
    }
  ];

  return (
    <div className="relative">
      {/* Mobile Menu Button */}
      <button
        onClick={() => setIsOpen(!isOpen)}
        className="md:hidden fixed top-4 left-4 z-50 p-2 rounded-md bg-gray-800 text-white focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-gray-800 focus:ring-white"
        aria-label={isOpen ? "Close menu" : "Open menu"}
      >
        {isOpen ? <FiX size={24} /> : <FiMenu size={24} />}
      </button>

      {/* Sidebar */}
      <div
        className={`fixed inset-y-0 left-0 z-40 w-64 bg-gray-900 text-white transform transition-transform duration-300 ease-in-out ${isOpen ? "translate-x-0" : "-translate-x-full"} md:translate-x-0`}
        role="navigation"
        aria-label="Main navigation"
      >
        {/* Logo Area */}
        <div className="h-16 flex items-center justify-center border-b border-gray-800">
          <span className="text-xl font-bold">Dashboard</span>
        </div>

        {/* Navigation Items */}
        <nav className="mt-5 px-2">
          {navigationItems.map((section, sectionIndex) => (
            <div key={sectionIndex} className="mb-8">
              <h2 className="px-3 text-xs font-semibold text-gray-400 uppercase tracking-wider">
                {section.category}
              </h2>
              <div className="mt-3 space-y-1">
                {section.items.map((item, itemIndex) => (
                  <button
                    key={itemIndex}
                    className={`w-full group flex items-center px-3 py-2 text-sm font-medium rounded-md transition-colors duration-150 ease-in-out ${item.current ? "bg-gray-800 text-white" : "text-gray-300 hover:bg-gray-800 hover:text-white"}`}
                    aria-current={item.current ? "page" : undefined}
                  >
                    <span className="mr-3 text-lg">{item.icon}</span>
                    <span>{item.name}</span>
                    {item.current && (
                      <span className="ml-auto h-2 w-2 rounded-full bg-indigo-500"></span>
                    )}
                  </button>
                ))}
              </div>
            </div>
          ))}
        </nav>
      </div>

      {/* Overlay for mobile */}
      {isMobile && isOpen && (
        <div
          className="fixed inset-0 bg-black bg-opacity-50 z-30"
          onClick={() => setIsOpen(false)}
          aria-hidden="true"
        ></div>
      )}
    </div>
  );
};

export default Sidebar;
